import React from "react";

function MapIp({ cordinates }) {

  const position = [cordinates?.lat, cordinates?.lng];
  const mymap = L.map('mapid').setView(position, 13);


  return <div id="mapid" className="h-64"></div>;
}

export default MapIp;
